import { Router } from 'express'
import sql from 'mssql'
//import config from './config'

const setting = {  
user: 'colegio',  
password: 'hola',  
server: 'core',  
database: 'IMBPC',
synchronize: true,
encrypt: true,
trustServerCertificate: true  
}  

const poolPromise = new sql.ConnectionPool(setting)  
.connect()  
.then(pool => {  
console.log('Connected to Server Core')  
return pool  
})  
.catch(err => console.log('Database Connection Failed! Bad Config: ', err)) 

const router = Router()
//const { poolPromise } = sql

//Raiz
router.get('/AlumnoCta', async (req, res) => {   
try {  
    const pool = await poolPromise  
    const result = await pool.request()  
    console.log(req.body.Carnet) 
    console.log(req.body.idciclo) 
    .input("Carnet", sql.VarChar(12), req.body.Carnet)  
    .input("Idciclox", sql.Int, req.body.idciclo)      
    .execute('Colegio.GetCtaCorrienteWS_Campus',function(err, profileset){  
        if (err)  
        {  
            console.log(err)  
        }  
        else {  
            var send_data = profileset.recordset  
            res.json(send_data)  
        }  
    })  
    } catch (err) {  
        res.status(500)  
        res.send(err.message)  
    }  
})  
 
export default router;

